import{_ as a}from"./plugin-vue_export-helper-c27b6911.js";import{o as e,c as i,f as r}from"./app-371aab79.js";const l={},t=r('<h1 id="_0f-其他话题" tabindex="-1"><a class="header-anchor" href="#_0f-其他话题" aria-hidden="true">#</a> 0F.其他话题</h1><p>未归类的话题。</p><h2 id="_0f-01-为什么是dota的英雄" tabindex="-1"><a class="header-anchor" href="#_0f-01-为什么是dota的英雄" aria-hidden="true">#</a> 0F.01.为什么是dota的英雄</h2><p>有这样一个团队，她是做对日金融的，穿拖鞋裤衩上班，课间可以团dota，cs，跑跑卡丁车。 日本人组团爱上了瓜子，黄飞红，米线，火锅。团队只有一个要求，活干的漂亮，快，零缺陷。</p><p>我本人与dota有缘无分，现在也就连直播都不爱看了，只是心中有个地方，叫dota</p><ul><li>TI6，她在西雅图，我在特拉华</li><li>TI9，她在奔驰馆，我在大虹桥</li></ul><h2 id="_0f-02-项目文档有很多错别字" tabindex="-1"><a class="header-anchor" href="#_0f-02-项目文档有很多错别字" aria-hidden="true">#</a> 0F.02.项目文档有很多错别字</h2><p>如果非要找个理由的话，</p><ul><li>输入法不给力，候选词提示歪了</li><li>我是个理科生，语文不好</li><li>脑子转的快，手指头跟不上</li></ul><h2 id="_0f-03-一个功能居然写到情绪奔溃" tabindex="-1"><a class="header-anchor" href="#_0f-03-一个功能居然写到情绪奔溃" aria-hidden="true">#</a> 0F.03.一个功能居然写到情绪奔溃</h2><p>从来没有那个功能写到我有点奔溃，TinyTask算第一个，记录一下。</p><p>这个功能本身需求不是那么强烈，搁置了很久，最后还是捡了起来，因为</p><ul><li>spring batch有点笨重</li><li>xxl-job目前用不上</li><li>@Scheduled不能取消，没有通知和并发控制</li></ul><p>所以就慢慢的设计了TinyTask的基本框框，当处理Misfire和并发的时候， 自己🐑了，脑子不够用，一遍一遍在脑子里推演，却陷了进去，死活出不来。</p><p>当时非常绝望，想删了代码，反悔为啥要做这个鸡肋的功能。</p><p>最后，移除了Misfire，简化了并发控制，🐑也好了，心情也恢复了些。 但当我准备写TinyTask文档时，心里有点空荡荡的，那是奔溃爆炸，夷为平地的地方。</p><p>TinyTask目前设计的很勉强，仅仅是@Scheduled的加强版。</p>',17),d=[t];function h(s,n){return e(),i("div",null,d)}const p=a(l,[["render",h],["__file","0f-qa-others.html.vue"]]);export{p as default};
